import Layout from '../components/layout'
import Head from 'next/head'

function AboutPage() {
  return (
    <Layout>
      <Head>
        <title>Custom Page Title</title>
      </Head>
      <h1>About</h1>
    </Layout>
  )
}

export default AboutPage
